package rpc

import (
	"bytes"
	"encoding/json"
	"github.com/dipperin/dipperin-core/common/hexutil"
	"github.com/dipperin/dipperin-core/common/log"
	"github.com/stretchr/testify/assert"
	"testing"
)

func webSocketUnmarshal(input string, t *testing.T) error {
	msg, err := hexutil.Decode(input)
	assert.NoError(t, err)
	log.DLogger.Info("the msg len is:", "msgLen", len(msg))

	dec := json.NewDecoder(bytes.NewReader(msg))
	dec.UseNumber()
	v := make(json.RawMessage, 0)
	err = dec.Decode(&v)
	return err
}

func Test_WebsocketUnMarshal(t *testing.T) {
	err := webSocketUnmarshal("", t)
	assert.NoError(t, err)

	err = webSocketUnmarshal("", t)
	assert.NoError(t, err)
}
